One day, a young boy with blonde hair appeared from the other side of the castle walls. His name was Flynn Scifo, and his voice was cold and firm when he said, &ldquo;this has nothing to do with me&hellip;&rdquo;
This is how the two young boys met&mdash;one who never held a sword before, and another who lost his sword, as the two collided, and stirred up the Lower Quarter.
As the world continued to spread out for the two, there was a wall of reality that stood in their way. Just how did the two overcome this obstacle?

As a child, Elijah became a count's famous footman, a master of his work... But &quot;his&quot; work is secretly more like &quot;her&quot; work, as Elijah is in fact a woman. So, every day, she wakes up at 6 AM, conceals her chest with bandages, and carries on her duty. And she will continue to do until, &quot;On my 18th birthday, I will quit my life as a footman and live as a woman!&quot; 

Yet, a sudden proposal comes: &quot;Elijah, you should dress up for the ball and become my partner.&quot; A perfect dress, never-before-seen makeup... and the gentle Count Albert as her escort. 

How will destiny unfold for Elijah?

